const ProfileCardManager = ({data}) => {

    const {image, name, id, address, placeOfBirth, gender, dob} = data;

    return ( 
        <div>
            <img src={image} alt={name} height="200px"/>
            <h3>Name: {name}</h3>
            <h3>Id: {id}</h3>
            <h3>Address: {address}</h3>
            <h3>PLace Of Birth: {placeOfBirth}</h3>
            <h3></h3>
            <h3></h3>
        </div>
    );
}

export default ProfileCardManager;
